import "./rightside.css"

const Rightside = () => {
  return (
    <div className='rightside'>
      <div className="right-top">
        <div></div>
      </div><hr/>
      <div className="right-middle">middle</div><hr/>
      <div className="right-bottom">bottom</div>
    </div>
  )
}

export default Rightside
